/**
* проверка на ввод только цифр для поля телефона
*/
function checkPhone(e){
	el = $(e);
	var val = el.val();
	val = val.replace(/[^0-9\(\)-\s\+]/gim,'');
	if(val != null){
		el.val(val);
	}else{
	   el.val('');
	}
}

/**
* проверка на ввод только цифр и точки
*/
function checkPrice(e){
	el = $(e);
	var val = el.val();
	var reg = /([0-9\.,]+)/gi;
	var arVal = reg.exec(val);

	if(arVal != null){
		el.val(arVal[0]);
	}else{
	   el.val('');
	}
}

/**
* проверка на ввод только цифр
*/
function checkNumber(e){
	el = $(e);
	var val = el.val();
	var reg = /([0-9]+)/gi;
	var arVal = reg.exec(val);

	if(arVal != null){
		el.val(arVal[0]);
	}else{
	   el.val('');
	}
}

/*animation*/

(function($) {
	$(document).ready(function() {
		scrollPos = window.pageYOffset || document.documentElement.scrollTop;

		height = $(window).height();
		$('.show-on-animated').each(function () {
			obj = $(this);
			if (!obj.hasClass('show-on-animated--show')) {
				pos = obj.offset().top+50;
				if (scrollPos+height > pos && scrollPos < pos+height) {
					obj.addClass('show-on-animated--show');
				}
			}

		});
	});
	$(window).scroll(function(){
		scrollPos = window.pageYOffset || document.documentElement.scrollTop;
		height = $(window).height();
		$('.show-on-animated').each(function () {
			if (!$(this).hasClass('show-on-animated--show')) {
				pos = $(this).offset().top+50;
				if (scrollPos+height > pos && scrollPos < pos) {
					$(this).addClass('show-on-animated--show');
				}
			}

		});
	});
})(jQuery);

