; /* Start:"a:4:{s:4:"full";s:99:"/local/components/internetclient/subcsribe.form.catalog/templates/.default/script.js?15302857601577";s:6:"source";s:84:"/local/components/internetclient/subcsribe.form.catalog/templates/.default/script.js";s:3:"min";s:0:"";s:3:"map";s:0:"";}"*/
$(document).ready(function(){

	//отправка формы
	$('.footer-subscription__form_submit').on('click', function(event){
		event.preventDefault(); 
		var blockSUb = $('.footer-subscription');
		var blobkMes = $('.footer-subscription__message');
		var blockText = $('.footer-subscription__message__content');
		var blockContent = blockSUb.find('.footer-subscription__content');
		var form = $('.footer-subscription__form').find('form');
		var inputText = form.find('input[type="text"]');
		
		if(inputText.val() == ''){
			inputText.css('border', 'solid 1px red');
		}else{
			inputText.css('border', 'none');
					
			$.post(
				//form.prop('action'),
				'/ajax/subcsribe-form.php',
				form.serialize(),
				function(data){
					result =  JSON.parse(data);
					//console.log(result); 
					if(result.ERROR){
						blockContent.hide();
						blockSUb.addClass('footer-subscription-active-error');
						blockText.html(result.ERROR)
						blobkMes.show();
												
					}else if(result.MESS){
						blockContent.hide();
						blockSUb.addClass('footer-subscription-active');
						blockText.html(result.MESS);
						blobkMes.show();
						inputText.val('');
					}
				}
			);
		}
		
	});
	
	$('.footer-subscription__message__close').on('click', function(event){
		event.preventDefault(); 
		var blockSUb = $('.footer-subscription');
		
		blockSUb.find('.footer-subscription__content').show();
		blockSUb.removeClass('footer-subscription-active');
		blockSUb.removeClass('footer-subscription-active-error');
		$('.footer-subscription__message').hide();
	});
});
/* End */
